export const style = {
	nodeDetailsTitle: {
		fontSize: 12,
		color: 'rgba(50, 50, 60, 0.6)',
		borderRight: '1px solid rgba(50, 50, 60, 0.3)',
		padding: 5,
		width: 70,
	},
	nodeDetailsText: {
		fontSize: 12,
		color: 'rgba(50, 50, 50, 1)',
		marginLeft: 10,
		padding: 5,
	},
	textGreen: { backgroundColor: 'rgba(0, 255, 0, 0.2)' },
	textRed: { backgroundColor: 'rgba(255, 0, 0, 0.2)' },
	nodeContainer: {
		position: 'relative',
		left: '25%',
		width: '50%',
		backgroundColor: 'rgba(240, 240, 240)',
		padding: 5,
		borderRadius: 5,
	},
	icon: {
		width: 24,
		height: 'auto',
		opacity: '0.5 !important',
	},
}
